import { Route, Routes, Link } from 'react-router-dom';
import './App.css';

// Define another component for the home route


function App() {
  return (
    <div className="App">
      <nav>
        <Link to="/">Home</Link>
      </nav>
      <Routes>
        <Route path="/" element={<App />} /> {/* Use a different component for the route */}
      </Routes>
    </div>
  );
}

export default App;
